	public static ArrayList<Integer> makeList(int limit){
		ArrayList<Integer> list = new ArrayList<Integer>();
		for(int i = 0; i<limit; i++){
			double r = Math.random()*1000;
			list.add((int)r);
		}
		System.out.println(list);
		return list;
	}
	
	public static ArrayList<Integer> makeGoodList(int limit){
		ArrayList<Integer> list = new ArrayList<Integer>();
		for(int i = 0; i<limit; i++){
			list.add(i+1);
		}
		System.out.println(list);
		return list;
	}
	
	public static ArrayList<Integer> makeBadList(int limit){
		ArrayList<Integer> list = new ArrayList<Integer>();
		for(int i = 0; i<limit; i++){
			list.add(limit-i);
		}
		System.out.println(list);
		return list;
	}
	
	public static void test(ArrayList<Integer> a){
		long start = System.currentTimeMillis();
		for(int i = 1; i<a.size(); i++){
			int key = a.get(i);
			int j = i-1;
			
			while (j >= 0 && a.get(j) > key){
				a.set(j+1, a.get(j));
				j = j - 1;
			}
			a.set(j+1, key);
		}
		long runtime = System.currentTimeMillis()-start;
		//System.out.println(a);
		System.out.println("Runtime: " + runtime + "ms");
	}
	

	public static void main(String[] args) {
		test(makeBadList(5000));
	}
